import React from 'react'

const Image = ({ imageInfo }) => {
  return (
    <div className='border-solid border-[20px] border-white'>
      <div>
        {imageInfo.name}
      </div>

      <div className='w-20 border-solid border-[20px] border-white'>
        <img src={imageInfo.generatedImage}></img>
      </div>

      <div>
        {imageInfo.prompt}
      </div>
    </div>
  )
}

export default Image
